// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract SimpleStorage{

struct data{
string name;
uint mobile;
string email;
uint manu_date;
uint warranty_start;
uint warranty_end;
}
uint private notsold;
uint private sold;
uint private year=2022;
mapping(uint =>mapping(string=>data))private product;




function get_total_unsold_product() public view returns(uint){

return notsold;
}



function get_total_sold_product() public view returns(uint){

return sold;
}



function set_new_product(string memory productid,string memory _name,uint _mobile, string memory _email) public {

require(bytes(product[year][productid].name).length == 0 , "product already exists");

product[year][productid]=data({name:_name,mobile:_mobile,email:_email,manu_date: block.timestamp,warranty_start:0 ,warranty_end:0 });

notsold++;
}


function set_warranty(string memory productid,uint warr_end) public  {
uint month=2629743;
uint warr_start=block.timestamp;
if(warr_end!=0){
    warr_end=warr_start+(month*warr_end);
}else{
    warr_end=warr_start+(month*3);

}
product[year][productid].warranty_start=block.timestamp;
product[year][productid].warranty_end=warr_end;
sold++;
}



function get_product_details(string memory id) external view returns(data memory) { 
require(bytes(product[year][id].name).length != 0 , "user not found");
 return product[year][id];

}




}
